import React from 'react'

export default function Body () {
  return (
    <div class='ui center segment stackable menu'>
      <div class='item'><i className='question circle icon' /></div>
      <a class='item'>Blog</a>
      <a class='item'>About</a>
      <a class='item'>Disclaimer</a>
    </div>
  )
}
